script: |
  super -f text -I q891.spq | sort > q891.out

inputs:
  - name: q891.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + 26 NOT BETWEEN - + CAST ( NULL AS INTEGER ) / col1 * - + col1 + + col2 + - col0 AND NULL;
  - name: tab1

outputs:
  - name: q891.out
    data: |
